import React from 'react';

const ReusableModal = ({ isOpen, onClose, children }) => {
  return (
    isOpen && (
      <div className="main">
        <div className="modal">
          <button className="modal-close" onClick={onClose}>
            &times;
          </button>
          {children}
        </div>
      </div>
    )
  );
};

export default ReusableModal;
